import React from 'react';
import styled from 'styled-components';
import Container from 'react-bootstrap/Container';
import {PostJumbotron} from './../components/PostJumbotron';
import {Footer} from './../components/Footer';


const Styles = styled.div`
    .row {
        margin-left: 0px;
        margin-right: 0px;
        font-family: 'Montserrat', sans-serif;
    }

    .col {
        text-align: center;
    }
`;

const PStyled = styled.p`
    font-size: 21px !important;
    margin-bottom: 30px;
    font-family: 'Montserrat', sans-serif;
`;


export const Quadratic = () => {
    return (
        <Styles>
            <PostJumbotron 
                date = 'October 10th, 2019'
                title = 'What I Learned About Life From Buying a Goat on Craigslist'
                subTitle = 'One goat became two, then a whole farm, then a crash course in what really matters'>
            </PostJumbotron>
            <Container style = {{paddingTop: 80, paddingBottom: 70, paddingLeft: 120, paddingRight: 120}}>
                <PStyled>
                    If you’re giving your curiosity the last word, this doesn’t make you or 
                    your work any less valuable. Betting on yourself and having the patience 
                    to stay the course, through thick and thin, makes you even more admirable.
                </PStyled>
