                    this doesn’t make you or your work any less valuable. Betting on yourself 
                    and having the patience to stay the course, through thick and thin, makes 
                    you even more admirable.Prior to her tipping point, Rogers had the courage 
                    to let the world in. While studying in France, during her hiatus from writing 
                    folk songs, she felt a strong attraction to dance music — something that had 
                    always felt artificial to her. When she started to write songs again, her 
                    decision to step out of her life and into the world proved useful. She couldn’t 
                    stop creating. Ultimately, this new love of dance music, combined with her old 
                    love of folk, led Rogers to meld the two genres, the result of which Williams 
                    heard that day.
                </PStyled>
            </Container>
            <Footer></Footer>
        </Styles>
    );
}
